import React, { useState } from "react";
import styles from "../styles/CheckoutPage.module.css";
import { useCart } from "../context/CartContext";
import Header from "../components/Header";

export default function CheckoutPage() {
  const { cartItems, total, clearCart } = useCart(); // Отримуємо товари з кошика
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    address: "",
  });

  const [orderSuccess, setOrderSuccess] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleOrderSubmit = (e) => {
    e.preventDefault();

    // Додати логіку відправки замовлення на сервер
    console.log("Замовлення відправлено:", { formData, cartItems, total });

    // Очистити кошик і показати повідомлення про успішне замовлення
    clearCart();
    setOrderSuccess(true);
  };

  return (
    <div className={styles.container}>
      <Header />
      <h1 className={styles.title}>Оформлення замовлення</h1>
      {orderSuccess ? (
        <div className={styles.successMessage}>
          <h2>Дякуємо за ваше замовлення!</h2>
          <p>
            Ваше замовлення обробляється. Найближчим часом з вами зв'яжуться.
          </p>
        </div>
      ) : (
        <>
          <div className={styles.cartSummary}>
            <h2>Ваше замовлення</h2>
            <ul className={styles.cartList}>
              {cartItems.map((item) => (
                <li key={item.id} className={styles.cartItem}>
                  <p className={styles.itemName}>
                    {item.name} × {item.quantity}
                  </p>
                  <p className={styles.itemPrice}>
                    {item.price * item.quantity} ₴
                  </p>
                </li>
              ))}
            </ul>
            <div className={styles.total}>
              <p>Загальна сума: {total} ₴</p>
            </div>
          </div>

          <form onSubmit={handleOrderSubmit} className={styles.form}>
            <h2>Контактна інформація</h2>
            <label>
              Ім'я:
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
                className={styles.input}
              />
            </label>
            <label>
              Електронна пошта:
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
                className={styles.input}
              />
            </label>
            <label>
              Телефон:
              <input
                type="tel"
                name="phone"
                value={formData.phone}
                onChange={handleChange}
                required
                className={styles.input}
              />
            </label>
            <label>
              Адреса доставки:
              <textarea
                name="address"
                value={formData.address}
                onChange={handleChange}
                required
                className={styles.textarea}
              ></textarea>
            </label>
            <button type="submit" className={styles.submitButton}>
              Підтвердити замовлення
            </button>
          </form>
        </>
      )}
    </div>
  );
}
